<!DOCTYPE html>
<html lang="en" dir="ltr">
	<head>
		<meta charset="utf-8">
		<title></title>

		<link href="https://fonts.googleapis.com/css?family=Montserrat:300,400,500,600" rel="stylesheet">

		<style type="text/css">
		body{
			font-size: 0.95rem;
			background-color: #e9eaea;
		}
		body,html,*{
			color: #3e3e3e;
			font-family: 'Montserrat', sans-serif;
		}

		._title{
			margin-bottom: 2px;
			font-weight: 300;
		}

		.bar{
			margin: 0px auto;
			width: 672px;
			max-width: 100%;
			padding: 11px 15px;
			margin-bottom: 0px;
			background-color: #d7dada;
		}

		.header{
			margin: 25px auto 0 auto;
			width: 702px;
			max-width: 100%;
			padding: 11px 0px;
			margin-bottom: 0px;
			text-align: center;
			/* background-color: #222324; */
		}

		.header .logo{
			width: 250px;
			max-width: 94%;
		}

		.container{
			/* display: inline-block; */
			margin: 0 auto 0 auto;
			width: 700px;
			max-width: 100%;
			padding: 0px;
			border: 1px solid #d7dada;
			background-color: #fff;
			/* border-radius: 4px; */
			overflow: hidden;
		}

		.body-content{
			display: inline-block;
			width: 100%;
			padding: 18px;
		}

		table{
			border-collapse: collapse;
			width: 100%;
		}
		table td, table th{
			margin: 0;
			padding: 0;
		}
		.td-label{
			width: 185px;
		}

		.footer{
			display: inline-block;
			padding: 18px;
			width: 100%;
			font-weight: 600;
			text-align: center;
		}
		</style>
	</head>
	<body>

		<div class="header">
			<a href="#">
				<img class="logo" src="data:image/png;base64," />
			</a>
		</div>

		<!-- <div class="bar"></div> -->

		<div class="container">
			<div class="body-content">
				<h1 class="_title" style="margin: 0 0 13px 0; text-align:center;">Formulario de contacto</h1>

				<table id="mail" style="width: 100%;">
					<tr>
						<td class="body">
							<table style="width: 100%;">
								<tr>
									<td class="td-label"><b>Nombre: </b></td>
									<td>{!! $name !!}</td>
								</tr>
								<tr>
									<td class="td-label"><b>Email: </b></td>
									<td>{!! $email !!}</td>
								</tr>
                <tr>
									<td class="td-label"><b>Teléfono: </b></td>
									<td>{!! $phone !!}</td>
								</tr>
                <tr>
									<td class="td-label"><b>Mensaje: </b></td>
									<td></td>
								</tr>
                <tr>
									<td colspan="2">{!! $msg !!}</td>
								</tr>

							</table>
						</td>
					</tr>
				</table>
			</div>
		</div>

		<div class="bar" style="text-align: center;">MI PAW</div>

		<!-- <div class="footer">
			MI PAW
		</div> -->

	</body>
</html>
